プライバシー マスカラリムーバー 6ml<br>ブランド：プライバシー<br>販売・製造元：黒龍堂<br><br>塗ってる間に溶け落ちるマスカラリムーバーです。<br>コットンいらずで、まつげに負担をかけにくい。<br>特殊ジェルがまつげを包みこみ、素早くマスカラを浮かせます。<br>一緒に使うクレンジング料を選びません。<br> <br><br><br>使用方法<br>(1)クレンジング前に、乾いたまつ毛の根元からたっぷり塗って下さい。<br>(2)そのまま顔全体と目元のメイクをお手持ちのクレンジングでなじませます。<br>(3)最後に顔全体をお湯または水で一緒に洗い流します。<br>※まつ毛が束になっている場合がありますので、ゆっくりととかして下さい。<br> ご注意<br>●傷・はれもの・湿疹等、異常がある時は使用しないでください。<br>●使用中、又は使用後赤み・はれ・かゆみ・刺激等異常があらわれたときは、使用を中止し、皮膚科専門医等へご相談下さい。<br>●目に入らないようご注意ください。<br>もし入った場合は、すぐに水かぬるま湯で洗い流して下さい。<br>異物感が残る場合は眼科医にご相談下さい。<br>●使用後はコーム部分をきれいに拭き取り、しっかりキャップを閉めて下さい。<br>●直射日光・高温及び多湿を避けて保存してください。<br> <br>成分<br>イソドデカン、イソノナン酸イソノニル、ポリソルベート85、パルミチン酸エチルヘキシル、BG、ジステアルジモニウムヘクトライト、セスキオレイン酸ソルビタン、水、炭酸プロピレン、加水分解シルク、オタネニンジン根エキス、グリチルレチン酸ステアリル、アボカド油、オレンジ油、セテアリルアルコール、メドウフォーム油、セテアリルグルコシド、トコフェロール、フェノキシエタノール<br> 原産国日本 <br><br>お問い合わせ先<br>株式会社黒龍堂 お客様窓口：03-3431-4807受付時間：10：00-16：00(土曜、日曜、祝日は除く) <br>化粧品／メイクアップ／アイメイク／マスカラリムーバー<br>JANコード： 4901477704711<br><br>CS：36<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
