ヘビーローテーション カラーリングアイブロウ 01 イエローブラウン<br>ブランド：ヘビーローテーション<br>販売・製造元：伊勢半<br><br>髪色に合わせて眉色もふんわり明るいカラーにできる眉マスカラです。<br>●地肌につきにくく、眉にしっかり液が付くテクニカルブラシを採用しています。<br>●一度塗りでもしっかりと色が付き、重ねて塗るとさらに発色がよくなります。<br>●汗・水・皮脂・こすれに強く、長時間落ちにくいウォータープルーフタイプ。<br>フィルムタイプなので、ぬるま湯でスルッと簡単に落とせます。<br>(落とすときは40度くらいのお湯で簡単に落とせます。<br>落ちにくい場合は、40度くらいのお湯をコットンに含ませ、やさしく拭き取ってください。) <br><br><br>使用方法<br>パウダー・ペンシル・リキッドなど、他のアイブロウと併用する場合はその後に本品をお使いください。<br>その際、落とす時はクレンジング料をご使用ください。<br>(1)毛並みに逆らうように、眉山から眉頭に向かって塗ります。<br>(2)毛並みを整えながら、眉頭から眉尻に向かってとかすように塗ります。<br>●POINT・2度塗りでさらに高発色・・・はじめに塗った液が乾く前に重ね塗りすると、発色が増し、キレイに仕上がります。<br> ご注意<br>●傷、はれもの、湿疹など、異常のあるときは、ご使用をおやめください。<br>●使用中、又は使用後日光にあたって、赤味、はれ、かゆみ、刺激等の異常があらわれたときは、使用を中止し、皮フ科専門医等へのご相談をおすすめします。<br>そのまま他の化粧品も含めて使用を続けますと悪化することがあります。<br>●目に入ったときは、こすらず、すぐに水かぬるま湯で洗い流してください。<br>異物感が残る場合は眼科医へご相談をおすすめします。<br>●使用後は、容器の口元をきれいにふきとり、しっかりキャップを閉めてください。<br>●ブラシへのつきが少なくなった場合は、容器の壁面についている液をブラシで軽くかきまぜてからお使いください。<br>※眉用ですので、まつ毛には使用しないでください。<br> <br>成分<br>水、アクリル酸アルキルコポリマーアンモニウム、PG、TEA、アクリル酸アルキルコポリマー、パンテノール、デヒドロ酢酸Na、フェノキシエタノール、メチルパラベン、三リン酸5Na、プロピルパラベン、酸化鉄、マイカ、酸化チタン<br> 原産国日本 <br><br>お問い合わせ先<br>株式会社伊勢半03-3262-3123 <br>化粧品／メイクアップ／アイメイク／眉マスカラ<br>JANコード： 4901433137553<br><br>CS：300<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
