モイスタージュ エッセンスローション さっぱり 詰替用 200ml<br>ブランド：モイスタージュ<br>販売・製造元：クラシエホームプロダクツ販売<br><br>化粧水と美容液のW保湿でうるおいをキープする保湿化粧水です。<br>保湿成分コラーゲン・スクワラン・シルクプロテイン配合。<br>みずみずしくハリ・弾力のある素肌に整えます。<br>べたつかない感触で、お肌にスーッと浸透し、乾燥・肌荒れを防ぎます。<br>無香料・無着色・弱酸性。<br>詰め替え用。<br> <br><br><br>使用方法<br>手のひらに適量をとり、やさしく顔全体になじませてください。<br> ご注意<br>●お肌に合わない時、また傷・湿しん等がある時は使用しないでください。<br>●使用中、赤み・かぶれ・かゆみ・刺激等の異常が現れたときは使用を中止し、皮膚科専門医等へのご相談をおすすめします。<br>そのまま使用を続けると症状が悪化することがあります。<br> つめかえ方(1)注ぎ口部分をしっかり持ち、切り口をミシン目にそって切り取ってください。<br>(パックを強く持って切ると液が飛ぶことかあるのでご注意<br>ください)(2)ボトルが倒れないように手で固定し注ぎ口からゆっくり中身を入れてください。<br>※ノズル部分に汚れ等がある場合は、ふきとってから入れてください。<br>●必ずモイスタージュ エッセンスローションのボトルに詰め替えてください。<br>●詰め替え前に、ボトルの中を水道水でよく洗い、乾燥させてから、一度で全量詰替えてください。<br>●他の化粧水や水を混ぜないでください。<br>●詰め替え後、パック左下の製造番号を記録するか、切り取って容器に貼り付けてください。<br>(お問い合わせの際に必要な場合があります) 配合成分水、エタノール、DPG、グリセリン、PEG-20、トリイソステアリン酸PEG-20グリセリル、スクワラン、マルチトール、メチルグルセス-20、オレス-8リン酸Na、加水分解コラーゲン、ニコチン酸トコフェロール、ヒドロキシプロピルメチルセルロース、シルクエキス、乳酸、EDTA-4Na、メチルパラベン<br> 原産国日本 <br><br>発売元、製造元、輸入元又は販売元：クラシエホームプロダクツ株式会社でんわ：03-5446-3210 シルク(セリシン) 化粧水 とはシルクは、蚕の繭からとれる天然たんぱく質で人間に必要不可欠なアミノ酸を大量に含む為、保湿効果に優れ、お肌をツルツルにケアし、化粧のノリも良くするというすぐれもの。<br>昔から「古来養蚕農家の方は年をとっても肌がつやつやでシミ一つない」といわれるのはシルクのパワーなのです。<br><br>化粧品／化粧水・ジェル／化粧水／保湿化粧水<br>JANコード： 4901417644756<br><br>CS：24<br>区分：化粧品<br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
